            switch (PType)
            {
                case ProxyType.Http:
                    return HttpProxyClient.Parse(proxy);
                case ProxyType.Socks4:
                    return Socks4aProxyClient.Parse(proxy);
                case ProxyType.Socks5:
                    return Socks5ProxyClient.Parse(proxy);
                default:
                    return HttpProxyClient.Parse(proxy);
            }
        }

