                            }
                            if (TotalIpsGrabbed == 0)
                            {
                                ExtractProxies(Regex.Replace(result, @"([0-9]+\.[0-9]+\.[0-9]+\.[0-9]+):[\t ]+([0-9]+)", @"$1:$2"));
